import React from "react";
import Navbar from "../Navbar";
import CrecheSlider1 from "./CrecheSlider1";
import Searchbar2 from "./Searchbar2";

const Search = () => {
  return (
    <>
      <div>
        <Navbar />
      </div>
      
        <Searchbar2/>
        
        <CrecheSlider1 />
        <CrecheSlider1 />
       
      
    </>
  );
};

export default Search;
